import { Outlet, useLocation, useNavigate, useNavigation } from "react-router-dom";
import ProductsNavigation from "../components/ProductsNavigation";
import classes from "./ProductsPage.module.css"

const ProductsPage = () => {
    const location = useLocation();
    let productName = location.pathname;
    const result = productName.substr(10, 14);
    console.log(result);
    if(location.pathname === "/products/shoes") {
        productName = "shoes"
    }
    if(location.pathname === "/products/tshirts") {
        productName = "t-shirts"
    }
    if(location.pathname === "/products/pants") {
        productName = "pants"
    }
    return <>
        <ProductsNavigation />
        <h3 className={classes.explore}>Explore our latest {productName}</h3>
        <Outlet />
    </>
};

export default ProductsPage;
